import { useEffect, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import Navbar from "./Navbar";

const Welcome = () => {

  const [data, setData] = useState([]);
  let navigate = useNavigate();

  const getData = async () => {
    await fetch('db.json', {
      headers: {
        'Content-Type': 'application/json',
        'Accept': 'application/json'
      }
    })
      .then((res) => res.json())
      .then((res) => {
        console.log(res);
        setData(res);
      });
  };

  useEffect(() => {
    const getDataAsync = async () => {
      await getData();
    }
    getDataAsync();
  }, []);

  return (
    <>
      <Navbar />
      <div className="welcome-content">
        <div className="welcome-header">
          {
            data.parents !== undefined && data.parents.length > 0 &&
            <h1>Välkommen {data.parents[0].name}</h1>
          }
        </div>
        <div className="welcome-box">
        <div className="welcome-box">
          {
              data.parents !== undefined && data.parents.map((item, index) => {
                return (
                  <div key={index}>
                  <p>Du har {item.children.length} barn registrerat.</p>
                  {
                    item.children.map((child, index) => {
                      return (
                        <p key={index}>{child.name} - {child.age}</p>
                      )
                    })
                  }
                  </div>
                )})
          }
        </div>
          {/* {
            data.parents.children !== undefined && data.parents.children.length > 0 && data.parents.children.map((item) =>
            <p>Namn: {item.name} Ålder: {item.age}</p>
          )
          } */}
          {/* {
            data.parents !== undefined && data.parents.length > 0 && data.parents.map((item) => 
              <p>{item.name}</p>)
            }
            {
            data.package !== undefined && data.package.length > 0 && data.package.map((item) => 
              <p>{item.size}</p>)
            } */}
        </div>
        <button className="forward-button" onClick={() => { navigate('/select') }}>Gå Vidare</button>
      </div>
    </>
  );
}

export default Welcome;
